"use strict";
// All about (?) mark in typescript
// ? mark has many names in use case of typescript and they are
//  ? ======> ternery operator
// ?? ======> Nullish coalescing Operator
// ?  ======> Ternery Operator
// examples.....
const age = 20;
const adult = age >= 18 ? "Adult" : "Not adult";
console.log(adult);
